import React from "react";

const Footer=()=>{

    return(
        <div className="fixed-bottom"
        style={{
            backgroundColor: "coral",
          }}>
            <h3
            style={{
                textColor: "black",
                paddingTop:"45px",
                textAlign: "center",
              }}>TuleWapi</h3>

            <p
            style={{
                textColor: "black",
                paddingTop:"15px",
                textAlign: "center",
              }}>Find Popular Restaurants Near You</p>

             <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center"
        }}
      >
        <div style={{display:''}}>
          <a className="socials"><i class="fa fa-twitter" aria-hidden="true"></i></a>
          <a className="socials"><i class="fa fa-facebook-square" aria-hidden="true"></i></a>
          <a className="socials"><i class="fa fa-envelope" aria-hidden="true"></i></a>
        </div>



            <button 
            style={{
                textColor: "black",
                paddingTop:"15px",
                margin:"15px",
              }}
            className="btn btn-warning">Contact Us</button>
        </div>
        </div>
    )
}

export default Footer;
